import React from 'react';

const DEFAULT_STATE = {
    user: {
        firstImg: [],
        name: '',
        distance: '',
    }
};

class Card extends React.Component {

    state = {...DEFAULT_STATE};

    constructor(props){
        super(props);
        this.state.user = this.props.user;
        console.log(this.state);
    }

    render() {
        console.log("stateCard ---->" + this.state);
        const { user } = this.state;
        return (
            <div className="CardContainer">
                <span>{user.name}</span>
            </div>
        )
    }
}

export default Card;
